(38, 'Chair', 8, 5000, 10000, 'Patented SmartGRID Technology - Stylux seat is designed with Patented SmartGRID Technology that provides no pressure support to your tushy and cradles your tailbone thus helping you improve your natural sitting posture. Whether you’re sitting upright in focus mode or reclining to take a nap, the SmartGRID seat distributes your weight evenly, promoting healthy spinal alignment for all-day comfort.', -10, '/media/41BEtLA-nHL._SX522_%20(1).jpg', '/media/41BEtLA-nHL._SX522_%20(2).jpg', '/media/41BEtLA-nHL._SX522_.jpg', '/media/41raid3nnGL._SY679_%20(1).jpg', '/media/41raid3nnGL._SY679_.jpg', 0, 'deactivate', 'Alloy Steel', 'Victoria', 'H 86 x W 61 x D 66'),
