(40, 'Farina Half Leather ', 12, 90000, 100000, 'This sofa is designed to combat sagging. The multi-density foam in the seat cushions reduces sagging due to prolonged use. A grid of polyfill pockets in the back cushions prevents the cushions from weighing down because of gravity.', 18, '/media/FNSF52FACA3L_-_main_1.png', '/media/FNSF52FACA3L_-_main_2.jpg', '/media/FNSF52FACA3L_-_main_3.jpg', '/media/FNSF52FACA3L_-_main_4.jpg', '/media/FNSF52FACA3L_-_main_5.jpg', 0, 'deactivate', 'Leather', 'Victoria', 'H 102 x W 213 x D 76'),
(41, 'Emila Fabric Three S', 14, 17200, 80000, 'Next-level cosy. The Emila motorised recliner sofa takes comfort to a whole new dimension, with extra-plush armrests, headrests, and seats. The cleverly designed backrest reclines without taking up any extra space. Sink in, kick back, and cool your heels at the push of a button! Fabric upholstery', -3, '/media/Emila_Recliner_3_Seter_Color_Cream_1%20(1).jpg', '/media/Emila_Recliner_3_Seter_Color_Cream_1.jpg', '/media/Emila_Recliner_3_Seter_Color_Cream_5.jpg', '/media/Emila_Recliner_3_Seter_Color_Cream_8.png', '/media/Emila_Recliner_3_Seter_Color_Cream_3.jpg', 0, 'deactivate', 'Fabric', 'ARRA', 'H 102 x W 213 x D 76'),
(42, 'Brick  Pull Out Sofa', 12, 65000, 80000, 'Avoid keeping very hot or very cold materials on the wood directly, always use coasters or mats. Any spillage should be wiped dry with a soft cloth immediately as there is a chance of staining. Colour/polish can fade due to prolonged exposure to sunlight.', 46, '/media/Ditmas_Sofa_cum_Bed_Beige_and_Bro_1.jpg', '/media/Ditmas_Sofa_cum_Bed_Beige_and_Bro_2.jpg', '/media/Ditmas_Sofa_cum_Bed_Beige_and_Bro_3.jpg', '/media/Ditmas_Sofa_cum_Bed_Beige_and_Bro_4.jpg', '/media/Ditmas_Sofa_cum_Bed_Beige_and_Bro_5.jpg', 0, 'deactivate', 'Brick', 'Woodsworth', 'H 102 x W 213 x D 76'),
(43, 'Hamilton Solid Wood ', 17, 7500, 8000, 'Perfect to optimise space in the house, keep them folded into 1 and when you need 3 stools, voila! Extremely versatile, can be used as stool(s), centre table(s) , side table(s), small study table + stool for children Refer to the images for details of dimensions Medium-weight, thick structure Made of high-grade Sheesham wood Each of the stools can support a weight of starting from 35 kgs No assembly required', 10, '/media/Hamilton_Nested_Stools_Mahogany_02_3.jpg', '/media/Hamilton_Nested_Stools_Mahogany_03_4.jpg', '/media/Hamilton_Nested_Stools_Mahogany_09_10.jpg', '/media/Hamilton_Nested_Stools_Mahogany_06_7.jpg', '/media/Hamilton_Nested_Stools_Mahogany_07_8.jpg', 0, 'deactivate', 'Solid wood', 'Adorn Homez', 'H 102 x W 213 x D 76'),
(44, 'Twain Engineered Woo', 1, 7500, 10000, 'Full marks. A classic desk with pared down trestle legs, the Twain study table is elegant in its simplicity. The generous table has room for you to spread out, and the two deep drawers help keep a check on overflowing papers, files, and more. There’s plenty of space below for legs to stretch comfortably.   MDF table top with cherry melamine finish, and lacquered legs Refer to the images for dimension details Indoor use only', 3, '/media/Twain_Study_Table_1.jpg', '/media/Twain_Study_Table_2.jpg', '/media/Twain_Study_Table_NEW_dim2.png', '/media/Twain_Study_Table_9.jpg', '/media/Twain_Study_Table_NEW_Dim.png', 0, 'deactivate', 'Wood', 'Furnitech', 'H 102 x W 213 x D 76'),
(45, 'Leather Lounge Chair', 8, 6000, 8000, 'An icon in every sense of the word. The Lounge Chair & Ottoman (1956) designed by Charles E. and Ray E., is considered to be one of the most significant designs of the 20th century This high quality replica pairs sleek moulded plywood with soft artificial leather to create an inviting form that''s both beautiful and supremely comfortable The chair and ottoman are both mounted on swivelling metal bases Refer to the images for details of dimensions For indoor use only', 9, '/media/1956_Lounge_Ottoman_Replica_Black_15_16.jpg', '/media/1956_Lounge___Ottoman_Replica_Black_04.jpg', '/media/1956_Lounge___Ottoman_Replica_Black_New_Dim_2.png', '/media/1956_Lounge___Ottoman_Replica_Black_03.jpg', '/media/1956_Lounge___Ottoman_Replica_Black_09.jpg', 0, 'deactivate', 'Leather', 'Dreamzz Furniture', 'H 86 x W 61 x D 66');

